window.bookSummaryJSON = "<p>Defective. Fierce. A lonely survivor.&nbsp;</p> <p>When Oto didn’t connect to the system at adolescence like everyone else, his dreams for racing his way off-planet shattered into a million little pieces.&nbsp;</p> <p>A chance encounter out in the Wilds will fix his broken parts and set him back on the path to escaping his terrible life - but not in ways he could have ever expected.&nbsp;</p> <p>With new friends that he’ll have to learn to trust, and a race car to cultivate, Oto’s in over his head. But that’s never stopped him before.&nbsp;</p> <p>He’s going to go up against the city’s best and most dangerous racers to guarantee, once and for all, that he cannot be ignored.&nbsp;</p> <p><i>Zero Car</i> is a sci-fi LitRPG cultivation mix with sentient cars and lots of character.</p>"; 
